import React from 'react';
import { Item } from "../../types";

interface ItemLayOutProps {
    items: Item[];
}

const ItemLayOut: React.FC<ItemLayOutProps> = ({ items }) => {
    return (
        <main>
            <table>
                <thead>
                <tr>
                    <th>ID</th>
                    <th>Name</th>
                    <th>Price</th>
                    <th>Description</th>
                    <th>Category ID</th>
                    <th>Image Path</th>
                    <th>Amount</th>
                    <th>Current Stock</th>
                </tr>
                </thead>
                <tbody>
                {items.map(item => (
                    <tr key={item.id}>
                        <td>{item.id}</td>
                        <td>{item.name}</td>
                        <td>{item.price}</td>
                        <td>{item.description}</td>
                        <td>{item.category_id}</td>
                        <td>{item.image_path}</td>
                        <td>{item.amount}</td>
                        <td>{item.current_stock}</td>
                    </tr>
                ))}
                </tbody>
            </table>
        </main>
    );
};

export default ItemLayOut;
